import { createSlice } from "@reduxjs/toolkit";

const user = createSlice ({
    name: 'user',
    initialState: {
        userName: null,
        accessToken: null, 
        errors: null
    },

    reducers: {
        setUsername:  (store, action) => {
            store.username = action.payload
        },
        setAccessToken:  (store, action) => {
            store.username = action.payload
        },
        setsetErrors:  (store, action) => {
            store.username = action.payload
        }
    }
})

export default user
